import React from "react";

function Question(props)
{
	return (
			<div className="card">
				<h3>{ props.q.question_text }</h3>
				<div class="cardButtons">
					<button onEdit={ props.onEdit } className="edit">edit</button>
					<button onDelete={ props.onDelete } className="delete">delete</button>
				</div>
			</div>
	);
}

export default Question;
